import React, { Component } from 'react';

class Portfolio extends Component {

  render() {
    return (
      <div className="portfolio-container">
          <div className="unfocused portfolio-box"><h2>Victim Advice Line</h2></div>
          <div className="unfocused portfolio-box"><h2>Site 2</h2></div>
          <div className="unfocused portfolio-box"><h2>Site 3</h2></div>
          <div className="unfocused portfolio-box"><h2>Site 4</h2></div>
      </div>
    );
  }
}

export default Portfolio;
